import { Button,makeStyles } from "@material-ui/core";

const useStyle=makeStyles({
    create:{
        margin:20,
        background:'#6495ED'
    }
})


const Categroies=()=>{
    const classes=useStyle();
    return(
        <>
            <Button variant="contained" className={classes.create}>Create Blog</Button>
        </>

    ) 
}

export default Categroies;
